import React from 'react';
import { Container, Col, Row, Table } from 'reactstrap'

export default function SetSearch(props) {
    return (
        <Container>
            <Row>

                {props.setSearchState.allSets.map(set => <Col xs="12">{set.name}</Col>)}

            </Row>
        </Container>
    )
}
